I have a list of items in an array, and I want to sort them in a case-sensative way. For example, I have the following array:
var items = ["apple", "Apple", "Banana", "banana", "cherry", "Cherry"];
I want to sort them in a case-sensative way, so that the result is:
["Apple", "apple", "Banana", "banana", "Cherry", "cherry"];
I tried to use the following code:
items.sort(function(a, b) {
    return a.toLowerCase().localeCompare(b.toLowerCase());
but it doesn't work. It sorts the items in a case-insensitive way.
How can I sort the items in a case-sensative way?
You can use the localeCompare method to compare the strings in a case-sensitive way:
items.sort(function(a, b) {
    return a.localeCompare(b);
See the MDN documentation for more information.
